function findAll(n,t){db.DbManager.Device.findAll().then(function(i){t.render("devices",{title:"Device List",user:n.user,device:null,devices:i})})}function findById(n,t){n.params.id&&(console.log("Device Id:"+n.params.id),db.DbManager.Device.find({where:{DeviceId:n.params.id}}).then(function(i){t.render("devices",{title:"Device",user:n.params.id,device:i,devices:null})}))}function newDevices(n,t){db.DbManager.Device.find({where:{New:!0}}).then(function(i){t.render("newdevices",{title:"New Devices",user:n.params.id,device:null,devices:i})})}var db=require("../DbManager");exports.findAll=findAll,exports.findById=findById,exports.newDevices=newDevices